PhylogeneticAnalysis
{
"application": "PhylogeneticAnalysis",
"details": {
"software": [
"fasta",
"ruby",
"mafft",
"goalign",
"IQ-TREE",
"FastTree"
],
"resource": {
"queue": "geva",
"partition": "geva",
"cpus": 47,
"memory": "250000"
},
"description": "This script performs phylogenetic analyses for different viral clades. It utilizes various software packages for sequence alignment (MAFFT), gap trimming (goalign), and tree inference (IQ-TREE, FastTree). The script is run on a cluster with specific resource requirements specified in the SBATCH directives."
}
}
